import React, { PureComponent } from "react";

class User extends PureComponent {
  render() {
    return (
      <div>
        <div>
          {" "}
          ID : &nbsp;
          {this.props.user.userId}
        </div>
        <div>
          {" "}
          First Name : &nbsp;
          {this.props.user.userFirstName}
        </div>
        <div>
          {" "}
          Last Name : &nbsp;
          {this.props.user.userLastName}
        </div>
        <div>
          {" "}
          Role: &nbsp;
          {this.props.user.userRole}
        </div>
        <div>
          {" "}
          Email : &nbsp;
          {this.props.user.userEmail}
        </div>
      </div>
    );
  }
}

export default User;
